import { AfterViewInit, Component, ComponentFactoryResolver, OnInit, ViewChild, ViewContainerRef } from '@angular/core';
import { map, switchMap } from 'rxjs/operators';

import { ActivatedRoute } from '@angular/router';
import { DEMO_COMPONENTS } from './../comps';
import { PageHostDirective } from './page-host.directive';
import { ThirdComponent } from './../components/third/third.component';

@Component({
  selector: 'app-page-host',
  templateUrl: './page-host.component.html',
  styleUrls: ['./page-host.component.scss']
})
export class PageHostComponent implements OnInit {

  @ViewChild(PageHostDirective, {static: true}) compHost!: PageHostDirective;

  constructor(
    private componentFactoryResolver: ComponentFactoryResolver,
    private route: ActivatedRoute
  ) { }

  ngOnInit() {
    this.route.params.pipe(
      map(params => params.compName),
    ).subscribe(componentName => {
      const theOne = DEMO_COMPONENTS.filter(comp => comp.name === componentName)[0];
      this.loadComponent(theOne);
    })
    // this.route.url.subscribe(data => console.log('route url', data))
    // this.route.fragment.subscribe(data => console.log('frag', data))
    //   console.log('wheres my stuff', this.route.url);
  }

  loadComponent(componentType: any) {
    const componentFactory = this.componentFactoryResolver.resolveComponentFactory(componentType);

    const viewContainerRef = this.compHost.viewContainerRef;
    viewContainerRef.clear();

    const componentRef = viewContainerRef.createComponent<any>(componentFactory);
    // componentRef.instance.data = 'test';
    Object.assign({name: 'jerry', color: 'purple'}, componentRef.instance);
    componentRef.instance.name = "wtf is this shit"
    console.log('componentRef', componentRef.instance)
  }

  runTest() {
    axe
    .run()
    .then(results => {
      console.log(results)
      if (results.violations.length) {
        throw new Error('Accessibility issues found');
      }
    })
    .catch(err => {
      console.error('Something bad happened:', err.message);
    });
  }
}

